import React from "react";
import { LinkButton } from "../Button/Button.js";
import {
  Link
} from "react-router-dom";
import "./link.css"; 

export function LinkList ({root, lis}) {
  let elements = [];
  lis.forEach((li, i) => {
    elements.push(
      <li key={i}>
        <div>
          <h3>{li.name}</h3>
          <img src={li.thumb} alt={li.name}/>
        </div>
        <LinkButton to={`${root}/${li.name}`} alt={`Learn more about ${li.name}`} text="Learn more"/>
      </li>
    );
  });
  return(
    <ul>
      {elements}
    </ul>
  );
}

